  // }


  // const listList = store.map(list =>
  //   <List key={list.id} header={list.header} cards={cardList} />);
  return (
    <main className='App'>
      <header class="App-header">
        <h1>Trelloyes!</h1>
      </header>
      <div class="App-list">
        {store.lists.map(list=> (<List key={list.id} header={list.header} 
        cards={list.cardIds.map(id=>store.allCards[id])} /> ))}
      </div>
    </main>
  );
}

export default App;
